def action_code_split(text):
    if(debug):mydebug(inspect.currentframe())

    stack=[]

    read_chars=''
    liste=[]
    
    for c in text:
        if(c in ['{','[','(']):
            stack.append(c)
        elif(c in ['}',']',')']):
            stack.pop()
            
        if(not stack):
            if(c==','):
                liste.append(read_chars)
                read_chars=''
            else:
                read_chars=read_chars+c
        else:
            read_chars=read_chars+c

    if(read_chars):
        liste.append(read_chars)
            
    return liste
