def remove_enclosing_quotes(text):
    if(debug):mydebug(inspect.currentframe())
    
    pattern_enclosing_quote=re.compile(r'^\'(.*)\'$')

    text=pattern_enclosing_quote.sub(r'\1',text)
    return text

