def replace_suffixe(text,n,**opts):

    if(opts.get('ip_mode',False)):
        if(pattern_XX_ipv6.search(text)):
            suffix=":{}/".format(n)
            textre=pattern_XX_ipv6.sub(suffix,text)
        else:
            suffix=".{}/".format(n)
            textre=pattern_XX_ipv4.sub(suffix,text)
    else:
        suffix="{:02d}".format(n)
        textre=pattern_XX.sub(suffix,text)
    return(textre)
        
