def iterate_string(iter_mode,n,text,**opts):
    if(text):
        if(iter_mode=='$$'):
            text=replace_double_dollar(text,n)
        elif(iter_mode=='XX'):
            text=replace_suffixe(text,n,**opts)

    return text

