def iterate_array(iter_mode,n,ltext,**opts):
    liste=[]

    if(iter_mode=='iteration_disabled'):
        return ltext
    
    if(opts.get('deny_XX_mode',False) and iter_mode=='XX'):
        return ltext
        
    for text in ltext:
        liste.append(iterate_string(iter_mode,n,text,**opts))

    return liste
        
